import Layout from './components/Layout';
import './App.scss';
import { Route, Routes } from 'react-router-dom';
import Home from './components/Home';

function App() {
  return (
   <>
   <Routes>
    <Route path="/" element={<Layout />}></Route>
    <Route index element={<Home />}></Route>
   </Routes>
   </>
  );
}

export default App;
